style.css:
@-moz-document regexp(".*play.google.com/music/listen.*") {
/* Header Bar */

div.nav-bar {
background-color: rgb(234, 227, 203) !important;
}

/* Lefthand Navigation Pane */

div#nav {
background-color: rgb(234, 227, 203) !important;
}

div.fade-out-effect {
visibility:hidden !important;
}

div.playlistDropDown {
background-color: #e9e9e9 !important;
}

div.goog-ui-media-flash {
visibility:hidden !important;
}

/* Main Display Area */

div#main {
background-color: #042029 !important;
}
}
